import React from 'react';
import PostFeed from '../components/Feed/PostFeed';

const Home = () => {
    return (
        <div className="bg-gray-100 min-h-screen">
            {/* Navbar */}
            <nav className="bg-white shadow fixed top-0 left-0 right-0 z-50">
                <div className="container mx-auto px-4 py-3 flex items-center justify-between">
                    <div className="flex items-center space-x-2">
                        <img src="/logo192.png" alt="Logo" className="h-8 w-8" />
                        <span className="font-bold text-xl text-blue-700">Mini LinkedIn</span>
                    </div>
                    <div className="flex items-center space-x-6">
                        <a href="/" className="text-gray-700 hover:text-blue-700 font-medium">Home</a>
                        <a href="/profile" className="text-gray-700 hover:text-blue-700 font-medium">Profile</a>
                        <a href="/login" className="text-gray-700 hover:text-blue-700 font-medium">Logout</a>
                    </div>
                </div>
            </nav>

            {/* Main Content */}
            <div className="container mx-auto flex flex-col md:flex-row gap-6 px-4 pt-20">
                {/* Left Sidebar */}
                <aside className="hidden md:block md:w-1/4">
                    <div className="bg-white rounded-lg shadow p-4">
                        <div className="flex flex-col items-center">
                            <div className="w-20 h-20 bg-blue-200 rounded-full mb-2"></div>
                            <h2 className="font-semibold text-lg">John Doe</h2>
                            <p className="text-gray-500 text-sm text-center">Web Developer | React Enthusiast</p>
                        </div>
                        <hr className="my-4" />
                        <div>
                            <h3 className="font-semibold text-sm mb-2">Connections</h3>
                            <p className="text-gray-600 text-sm">Grow your network</p>
                        </div>
                    </div>
                </aside>

                {/* Feed */}
                <main className="w-full md:w-2/4">
                    <div className="bg-white rounded-lg shadow p-4">
                        <h1 className="text-xl font-bold mb-4 text-blue-700">Your Feed</h1>
                        <PostFeed />
                    </div>
                </main>

                {/* Right Sidebar */}
                <aside className="hidden md:block md:w-1/4">
                    <div className="bg-white rounded-lg shadow p-4">
                        <h3 className="font-semibold mb-2">Trending Topics</h3>
                        <ul className="space-y-2">
                            <li className="text-sm text-gray-600">#ReactJS</li>
                            <li className="text-sm text-gray-600">#NodeJS</li>
                            <li className="text-sm text-gray-600">#MongoDB</li>
                            <li className="text-sm text-gray-600">#WebDevelopment</li>
                        </ul>
                    </div>
                </aside>
            </div>
        </div>
    );
};

export default Home;
